import{_ as e,c as a,o as t,a4 as i}from"./chunks/framework.Caa1YTU6.js";const E=JSON.parse('{"title":"七牛云存储","description":"","frontmatter":{},"headers":[],"relativePath":"frontend/other/七牛云cdn加速图片.md","filePath":"src/frontend/other/七牛云cdn加速图片.md","lastUpdated":1722256713000}'),l={name:"frontend/other/七牛云cdn加速图片.md"},r=i('<h1 id="七牛云存储" tabindex="-1">七牛云存储 <a class="header-anchor" href="#七牛云存储" aria-label="Permalink to &quot;七牛云存储&quot;">​</a></h1><h2 id="注册使用" tabindex="-1">注册使用 <a class="header-anchor" href="#注册使用" aria-label="Permalink to &quot;注册使用&quot;">​</a></h2><ol><li>注册地址：<a href="https://portal.qiniu.com/signup" target="_blank" rel="noreferrer">七牛云</a></li><li>进入控制台--&gt;进入对象储存</li><li>空间管理--&gt;新建空间</li><li>建议好空间就可以进入域名，进行添加域名了</li><li>添加域名之后记得在域名平台进行解析域名提供的CNAME了</li><li>之后就可以直接上传图片到七牛云了</li></ol><h2 id="文件管理" tabindex="-1">文件管理 <a class="header-anchor" href="#文件管理" aria-label="Permalink to &quot;文件管理&quot;">​</a></h2><ol><li>进入空间管理，点击上传文件，之后使用绑定的域名</li></ol><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_03.png" alt="image-20200410130849552"></p><ol start="2"><li><p>之后复制文件名，添加前缀为你的域名地址就可以直接访问该图片了（需要对空间设置<strong>公共空间</strong>）</p><p>如：<code>https://notecdn.hrhe.cn/images/logo.png</code></p></li></ol><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_09.png" alt="image"></p><h2 id="图片裁剪" tabindex="-1">图片裁剪 <a class="header-anchor" href="#图片裁剪" aria-label="Permalink to &quot;图片裁剪&quot;">​</a></h2><img src="https://notecdn.hrhe.cn/images/七牛云cdn加速图片_04.png" alt="image-20200410133310805" style="zoom:25%;"><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_05.png" alt="image-20200410133340019"></p><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_06.png" alt="image-20200410133353668"></p><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_07.png" alt="image-20200410133411955"></p><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_08.png" alt="image-20200410133430938"></p><p>之后直接指定宽高即可，处理接口拼接在图片地址后面，就可以直接访问了，如下：</p><p><code>https://notecdn.hrhe.cn/logo.png?imageView2/1/w/1920/h/1080/q/75</code></p><h2 id="获取密钥" tabindex="-1">获取密钥 <a class="header-anchor" href="#获取密钥" aria-label="Permalink to &quot;获取密钥&quot;">​</a></h2><ol><li>进入密钥管理，就可以获取密钥了</li></ol><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_01.png" alt="image-20200410130518239"></p><p><img src="https://notecdn.hrhe.cn/images/%E4%B8%83%E7%89%9B%E4%BA%91cdn%E5%8A%A0%E9%80%9F%E5%9B%BE%E7%89%87_02.png" alt="image-20200410130627490"></p><h2 id="typora上传" tabindex="-1">Typora上传 <a class="header-anchor" href="#typora上传" aria-label="Permalink to &quot;Typora上传&quot;">​</a></h2><ol><li>上传服务选PicGo，然后下载PicGo</li></ol><p><img src="https://s21.ax1x.com/2024/08/12/pApMNSx.png" alt="image"></p><ol start="2"><li><p>PicGo配置七牛云</p><p><img src="https://s21.ax1x.com/2024/08/12/pApM0mD.png" alt="image"></p><p><img src="https://s21.ax1x.com/2024/08/12/pApMgpt.png" alt="image"></p></li><li><p>参数介绍：</p><ul><li>获取access&amp;secre：<a href="https://portal.qiniu.com/developer/user/key" target="_blank" rel="noreferrer">https://portal.qiniu.com/developer/user/key</a></li><li>设定Bucket：空间管理名字</li><li>设定访问网站：自己的cdn网址</li><li>设定存储区域： <ul><li>首先在<code>空间概览</code>找到存储区域</li><li>访问文档查找代码：<a href="https://developer.qiniu.com/kodo/1671/region-endpoint-fq" target="_blank" rel="noreferrer">https://developer.qiniu.com/kodo/1671/region-endpoint-fq</a></li></ul></li></ul></li><li><p>picgo推荐插件</p><ul><li><p>compress 压缩图片</p></li><li><p>folder-name 上传时使用与本地相同的文件路径</p></li></ul></li><li><p>配置完之后验证</p><p><img src="https://s21.ax1x.com/2024/08/12/pApQruT.png" alt="image"></p></li></ol><h2 id="其他公共cdn地址" tabindex="-1">其他公共cdn地址 <a class="header-anchor" href="#其他公共cdn地址" aria-label="Permalink to &quot;其他公共cdn地址&quot;">​</a></h2><ul><li><a href="https://imgse.com/" target="_blank" rel="noreferrer">https://imgse.com/</a></li></ul>',26),n=[r];function o(p,c,s,h,d,m){return t(),a("div",null,n)}const _=e(l,[["render",o]]);export{E as __pageData,_ as default};
